import React, { Component } from 'react';
import './App.css';
import NewTodo from './NewTodo';
import ToDo from './ToDo';

class App extends Component {
  render() {
    return (
      <div id="mainSection">
        <ToDo id="newToDo" text="hello world" />
        <NewTodo />
      </div>
    );
  }
}

export default App;
